        private int getInt(byte[] data, int index)
        {
            PackOperate operate = new PackOperate();

            operate.SetBytes(data);

            operate.GetBytes(index, true);

            return BitConverter.ToInt32(operate.GetBytes(4), 0);

        }

        private uint getUInt(byte[] data, int index)
        {
            PackOperate operate = new PackOperate();

            operate.SetBytes(data);

            operate.GetBytes(index, true);

            return BitConverter.ToUInt32(operate.GetBytes(4), 0);

        }


        private uint UBFX(uint c, int m, int n)
        {

            string txt = "";

            for (int i = 0; i < n; i++)
            {
                txt += "1";
            }

            n = Convert.ToInt32(txt, 2);

            return (uint)((c >> m) & n);

        }
        private long UBFX(long c, int m, int n)
        {

            string txt = "";

            for (int i = 0; i < n; i++)
            {
                txt += "1";
            }

            n = Convert.ToInt32(txt, 2);

            return (c >> m) & n;

        }



        private byte[] ToRC4(byte[] keys, byte[] data)
        {

            byte[] box = GetKeys(keys, 1);
            int x = 0;
            int y = 0;
            byte[] outData = new byte[data.Length];
            for (int i = 0; i < data.Length; i++)
            {
                x = (x + 1) % 256;
                x = (x + 1) % 256;
                x = (x + 1) % 256;
                y = (box[x] + y) % 256;
                byte swapByte = box[x];
                box[x] = box[y];
                box[y] = swapByte;
                outData[i] = (byte)(data[i] ^ box[(box[x] + box[y]) % 256]);
            }
            return outData;
        }



        private byte[] GetKeys(byte[] keys, int type = 1)
        {
            byte[] box = Enumerable.Range(0, 256).Select(i => (byte)i).ToArray();


            for (int i = 0, j = 0; i < 256; i++)
            {
                if (type == 1)
                {
                    j = (keys[i % keys.Length] + box[i] + j + i) % 256;
                }
                else
                {
                    j = (keys[i % keys.Length] + box[i] + j) % 256;
                }
                byte swapByte = box[i];
                box[i] = box[j];
                box[j] = swapByte;


            }
            return box;
        }

